    data: |
      SELECT DISTINCT 90, + 37 + - col1 * - + col1 * - 14 + - + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q3075.out
    data: |
      90	-6224
      90	-74
      90	-91832
